import React from "react";
import "./output.css";

function Test() {
  return (
    <div className="w-[159px] h-11 relative bg-[#914bf1] rounded-lg overflow-hidden">
      <div className="w-[159px] h-6 left-0 top-[10px] absolute overflow-hidden">
        {/* <div className="w-[56.95px] h-[16.80px] left-[51.02px] top-[-17px] absolute"></div> */}
        <div className="w-[7.32px] h-[12.80px] left-[51.02px] top-[3.60px] absolute text-white text-sm font-bold font-outfit leading-none">
          Let's Talk
        </div>
      </div>
    </div>
  );
}

export default Test;
